import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import { bannerData } from '../constant/data';

const responsive = {
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 1
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 1 // Corrected typo from "item" to "items"
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1 // Corrected typo from "ite" to "items"
  }
};

const Banner = () => {
  return (
    <Carousel 
    responsive={responsive}>
      {bannerData.map(data => (
        <img key={data.id} src={data.url} alt="banner" /> // Added key prop to img elements
      ))}
    </Carousel>
  );
};

export default Banner;
